import { useEffect } from 'react';
import './App.css';

function App() {

const API_KEY = process.env.REACT_APP_API_KEY
const url = "https://api.spoonacular.com/recipes/complexSearch"

useEffect(() => {
  fetch(`${url}?query=vegan`)
  .then(res => res.json)
  .then(data => console.log(data))
})

  return (
    <div className="App">
      yo, i'm the app
    </div>
  );
}

export default App;
